import React from "react";
import {BrowserRouter, Navigate, NavLink, Redirect, Route, Routes} from "react-router-dom";
import Footer from "./Footer";
import Header from "./Header";
import BlogOne from "./BlogOne";
import BlogTwo from "./BlogTwo";
import Navbar from "./Navbar";
import BlogThree from "./BlogThree";
import './Main.css'
import Home from "./Home";
import {Card, CardContent, CardMedia} from "@material-ui/core";

function Main(){


    return(
   <div className={"main"}>
       <style>
           @import url('https://fonts.googleapis.com/css2?family=Indie+Flower&family=Nunito:wght@200&family=Patrick+Hand&display=swap');
       </style>


       <Card className={"card"} style={{backgroundColor: "#5D8598", borderRadius: 25}}>
           <CardContent className={"content"}>
               <CardMedia className={"media"}>
                   <img src={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTIu3of9fE2gB_pXeJrm_CikoankIZJH1Bd-Q&usqp=CAU"}
                        alt={"Here to say hello"}/>
               </CardMedia>
               <h3 className={"intro"}><NavLink to={"/blogone"}>Introduction</NavLink></h3>
               <h5 className={"date"}>Date written: </h5>
               <p className={"p"}>Learn more about me, what plus size means, and how this website can positively effect you in the
                   long run.</p>
           </CardContent>
       </Card>

       <p className={"pTwo"}>Keep yourself updated with the latest top stories from New York Times:</p>
       <BrowserRouter>
           <Navbar/>
           <Header/>

           <Routes>
               <Route path="/blogone" element={<BlogOne/>}/>
               <Route path="/blogtwo" element={<BlogTwo/>}/>
               <Route path="/blogthree" element={<BlogThree/>}/>
               <Route path="/home" element={<Home/>}/>
           </Routes>
           <Footer/>
       </BrowserRouter>
   </div>
    )
}

export default Main;

